            OSIS.PEPPAM.BOM.Horarios_MasterCollection ret = OSIS.PEPPAM.BOM.Horarios_MasterCollection.PageLoadAllPaging(1, 1000000,searchString, null);

	            totalCount = ret.TotalRowCount;
            if (ret == null)
            {
                return new List<OSIS.PEPPAM.Mvc.Models.Horarios_MasterModel>();
            }

            var result = ret.Select(
                _horariosMaster =>
                    new OSIS.PEPPAM.Mvc.Models.Horarios_MasterModel()
                    {
                Horario_Numero = _horariosMaster.Horario_Numero,
                Ruta_Secuencia = _horariosMaster.Ruta_Secuencia,
                Horario_Descripcion = _horariosMaster.Horario_Descripcion,
                Horario_Cantidad_Dias = _horariosMaster.Horario_Cantidad_Dias,
                Horario_Turnos_Cantidad = _horariosMaster.Horario_Turnos_Cantidad,
                Registro_Estado = _horariosMaster.Registro_Estado,
                Registro_Fecha = _horariosMaster.Registro_Fecha,
                Registro_Usuario = _horariosMaster.Registro_Usuario,

                    }).ToList();

            return result;
        }

	} 
